import React, { useState }  from 'react';




const Listnote = (props) =>{

    const [value, setValue] = useState({
        title : '',
        para : ''
    }
    )

    const inputVal = (e) =>{
        const val = e.target.value;
        const name = e.target.name;

        setValue((olddata)=>{
            return {...olddata, [name] : val}
        })
      
    }


    const added = ()=>{
        props.button
    }


    return(
        <div>
            <input placeholder= "title" onChange = {inputVal} value = {value.title} name = "title"/><br/>
            <textarea rows="" cols="" onChange = {inputVal} value = {value.para} name="para" /><br/>
            <button onClick = {added} >Add</button>
        </div>
    )
}


export default Listnote ;
